      <Fragment>
        <Container>
          <Row>
            <Col lg={6} md={6} sm={12}>
              <h1>Quick Connect</h1>
              <Form>
                <Form.Group controlId="formBasicEmail">
                  <Form.Label>Name</Form.Label>
                  <Form.Control type="text" placeholder="Enter name" />
                </Form.Group>

                <Button variant="primary" type="submit">
                  Submit
                </Button>
              </Form>
            </Col>
            <Col lg={6} md={6} sm={12}>
              <h1>Discuss Now</h1>
              <p>Kollanpu Mddho paikpara</p>
              <p>9238479023847</p>
            </Col>
          </Row>
        </Container>
      </Fragment>
    );
  }
}

export default contact;
